import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './style.js';
import { GlobalStyle } from './style';

ReactDOM.render(
  <GlobalStyle>
    <App />
  </GlobalStyle>,
  document.getElementById('root')
);
